  <div class="help-main">
    <h2 class="help-title">Help</h2>
    <h3>Log in Information</h3>
    <p>Whether a user reaches the WebAccess login page directly or via a protected service, the process is the same. When users arrive at the WebAccess Authentication page, they will be presented with up to three log in fields:</p>
    <h4>User ID</h4>
    <p>Enter your Penn State Account user ID (e.g. xyz5000) </p>
    <h4>Password</h4>
    <p>Enter your Penn State Account password </p>
    <h3>Session Time Limit</h3>
    <p>The system provides pre-set timeouts, which aid in minimizing the exposure of forgotten web browser sessions. If you have not visited any protected service or the WebAccess log in page within the last 6 hours, an idle timer will end your session thus requiring you to re-authenticate. In addition, the system has a maximum time limit of 15 hours.</p>
    <h3>Log out Information</h3>
    <p>In order to protect their respective digital identities, users are highly encouraged to log out from WebAccess when finished using a WebAccess-protected service. Each WebAccess-protected service should provide a log out link, or the WebAccess log out function on the <a href="/services/">services page</a> may be used. Users also are encouraged, once log out is complete, to exit/quit the web browser completely for added security.</p>
    <h2>Frequently Asked Questions</h2>
    <h3>I tried to log in, but I see the services page. Why?</h3>
    <p>You already authenticated via WebAccess. Since you are logged in, the server presents the list of <a href="https://webaccess.psu.edu/services/">services</a> rather than the login page. To gain access to the service, click on the link from the list or enter the web address of the service in your browser. </p>
    <h3>I went to a WebAccess-protected page and I wasn't required to log in. Is there a security problem?</h3>
    <p>No. You already authenticated via WebAccess and thus are enjoying the benefits of not needing to re-authenticate. Don't forget to log out once you are finished.</p>
    <h3>I authenticated via WebAccess earlier, but the log in page appeared again. Why?</h3>
    <p>The system provides pre-set timeouts, which aid in minimizing the exposure of forgotten browser sessions. If you have not visited any protected services or the WebAccess log in page within 6 hours, your session will end. In addition, the system has a maximum time limit of 15 hours.</p>
    <h3>WebAccess and protected services keeps trying to set cookies. Why?</h3>
    <p>The system used by WebAccess is based on session cookies. These session cookies (which are not saved when you exit the web browser) are used to identify you to WebAccess and each protected service. They do not contain any information about you.</p>
    <h3>Who can I contact for assistance?</h3>
    <p>
      If you're a user and experiencing problems with authentication, then please contact the
      <a href="http://helpdesk.psu.edu/">ITS Service Desk staff</a> at
      <a href="mailto:helpdesk@psu.edu">helpdesk@psu.edu</a>. In the body of your e-mail message, include the following:
    </p>
      <ul>
        <li>Penn State Account user ID (for example, xyz5000)</li>
        <li>Time the error occurred</li>
        <li>Error message(s) received, if any</li>
        <li>Web browser used and version (for example, Mozilla Firefox 34 or Internet Explorer 11)</li>
        <li>Platform and operating system (for example, Macintosh OS 10.6 or Windows 7)</li>
      </ul>
    <h3>What is WebAccess?</h3>
    <p>The Penn State WebAccess system provides an environment in which users can authenticate/log in one time with their respective Penn State Account user ID and password to a central server in order to access multiple services protected with WebAccess without needing to re-authenticate. For example, a user can authenticate via Penn State WebAccess and then access services, such as the <a href="https://portal.psu.edu/">Penn State Portal</a>, <a href="https://webmail.psu.edu/">Penn State WebMail</a>, and a variety of other <a href="https://webaccess.psu.edu/services/">WebAccess-enabled services</a>, without needing to authenticate again to those services.</p>
    <h3>Who wrote Penn State WebAccess?</h3>
    <p>The Penn State WebAccess service is based on the University of Michigan's Cosign technology. This software, part of the NSF Middleware Initiative, and information is available via <a href="http://www.umich.edu/~umweb/software/cosign/">University of
				Michigan's Cosign Web site</a>. Portions of this quick reference document are based on documents provided, with permission, by the University of Michigan's Cosign information.The software is installed and customized for Penn State by
      <a href="https://security.psu.edu/identity-and-access-management/">Identity and Access Management (IAM)</a>, a unit of
      <a href="https://security.psu.edu/">Office of Information Security (OIS)</a>.</p>
    <h3>I would like to incorporate WebAccess into my Web site. Where can I find more information?</h3>
    <p>Please refer to the <a href="http://identity.psu.edu/services/authentication-services/webaccesscosign/">Penn State WebAccess</a> website.</p>
